import React, { Component } from 'react'

export default class RederCondition extends Component {
  login = false;
  userName = "Doan Hoang Thinh";
  render() {
    return (
      <div>
        {this.login === true ? <p>Hello {this.userName} nha</p> : <button>Ngu</button>};
      </div>
    )
  }
}
